CowboyRule_winning_hands_desc:
Los jugadores pueden apostar a cualquiera de las cinco categorías de manos ganadoras; 
a) carta alta, un par; 
b) dos pares; 
c) triple, escalera, color; 
d) full; 
e) póker, escalera de color, escalera real.
La recompensa del jugador se basa en las probabilidades de cada apuesta correcta.

CowboyRule_anyone_holecards_desc_1:
Los jugadores pueden apostar en tres categorías de las cartas privadas: 
a) del mismo palo, conectado, conectores del mismo palo; 
b) un par; 
c) par de aces
